import React, { Component } from "react";

class Profile extends Component {
    constructor() {
        super();
    }
    render() {
        return (
            <div style={{ background: "linear-gradient(to top, rgba(182, 30, 30, 0.7), rgba(255,255,255,0))" }} className="container-fluid py-5">
                <img alt="" style={{ height: "400px", width: "1300px", marginLeft: "70px" }} className="coverimg" src="images/coverimg.png" />
            </div>
        );
    }
}

export default Profile;
